import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const HeroContainer = styled.section`
  height: 100vh;
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  overflow: hidden;
`;

const BackgroundImage = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-image: url('https://images.pexels.com/photos/1927259/pexels-photo-1927259.jpeg?auto=compress&cs=tinysrgb&w=1920&h=1080&fit=crop');
  background-size: cover;
  background-position: center;
  z-index: -2;
  
  &::after {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: linear-gradient(
      45deg,
      rgba(0, 0, 0, 0.4) 0%,
      rgba(0, 0, 0, 0.2) 50%,
      rgba(0, 0, 0, 0.6) 100%
    );
  }
`;


const ContentContainer = styled.div`
  text-align: center;
  z-index: 1;
  max-width: 800px;
  padding: 0 20px;
`;

const MainTitle = styled(motion.h1)`
  font-size: clamp(3rem, 8vw, 8rem);
  font-weight: 100;
  color: #ffffff;
  margin-bottom: 20px;
  letter-spacing: 8px;
  line-height: 1.1;
  font-family: 'Playfair Display', serif;
  text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.3);
  
  @media (max-width: 768px) {
    font-size: clamp(2rem, 6vw, 4rem);
    letter-spacing: 4px;
  }
`;

const SubTitle = styled(motion.h2)`
  font-size: clamp(1.2rem, 3vw, 2rem);
  font-weight: 200;
  color: #ffd700;
  margin-bottom: 30px;
  letter-spacing: 4px;
  font-family: 'Playfair Display', serif;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.3);
  
  @media (max-width: 768px) {
    letter-spacing: 2px;
  }
`;

const Description = styled(motion.p)`
  font-size: clamp(1rem, 2vw, 1.3rem);
  font-weight: 300;
  color: rgba(255, 255, 255, 0.9);
  margin-bottom: 40px;
  letter-spacing: 1px;
  line-height: 1.6;
  max-width: 600px;
  margin-left: auto;
  margin-right: auto;
  text-shadow: 1px 1px 2px rgba(0, 0, 0, 0.3);
`;

const CTAButton = styled(motion.button)`
  padding: 18px 45px;
  background: linear-gradient(45deg, transparent, transparent);
  color: #ffd700;
  border: 2px solid #ffd700;
  font-size: 1.1rem;
  font-weight: 300;
  letter-spacing: 2px;
  cursor: pointer;
  transition: all 0.4s ease;
  backdrop-filter: blur(10px);
  background-color: rgba(255, 215, 0, 0.1);
  
  &:hover {
    background: #ffd700;
    color: #000;
    transform: translateY(-2px);
    box-shadow: 0 10px 30px rgba(255, 215, 0, 0.3);
  }
`;

const ScrollIndicator = styled(motion.div)`
  position: absolute;
  bottom: 30px;
  left: 50%;
  transform: translateX(-50%);
  display: flex;
  flex-direction: column;
  align-items: center;
  color: rgba(255, 255, 255, 0.7);
  font-size: 0.9rem;
  letter-spacing: 1px;
  
  &::after {
    content: '';
    width: 1px;
    height: 30px;
    background: linear-gradient(to bottom, #ffd700, transparent);
    margin-top: 10px;
    animation: pulse 2s infinite;
  }
  
  @keyframes pulse {
    0%, 100% { opacity: 0.3; }
    50% { opacity: 1; }
  }
`;

const Hero = () => {
  const titleVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: { 
        duration: 1.2,
        ease: "easeOut"
      }
    }
  };

  const subtitleVariants = {
    hidden: { opacity: 0, y: 30 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: { 
        duration: 1,
        delay: 0.3,
        ease: "easeOut"
      }
    }
  };

  const descriptionVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { 
      opacity: 1, 
      y: 0,
      transition: { 
        duration: 0.8,
        delay: 0.6,
        ease: "easeOut"
      }
    }
  };

  const buttonVariants = {
    hidden: { opacity: 0, scale: 0.8 },
    visible: { 
      opacity: 1, 
      scale: 1,
      transition: { 
        duration: 0.6,
        delay: 0.9,
        ease: "easeOut"
      }
    }
  };

  return (
    <HeroContainer>
      <BackgroundImage />
      <ContentContainer>
        <MainTitle
          variants={titleVariants}
          initial="hidden"
          animate="visible"
        >
          LUXE
        </MainTitle>
        
        <SubTitle
          variants={subtitleVariants}
          initial="hidden"
          animate="visible"
        >
          JEWELRY COLLECTION
        </SubTitle>
        
        <Description
          variants={descriptionVariants}
          initial="hidden"
          animate="visible"
        >
          Discover timeless elegance with our handcrafted jewelry pieces. 
          Each design tells a story of luxury, sophistication, and unparalleled beauty.
        </Description>
        
        <CTAButton
          variants={buttonVariants}
          initial="hidden"
          animate="visible"
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
        >
          EXPLORE COLLECTION
        </CTAButton>
      </ContentContainer>
      
      <ScrollIndicator
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 1.5, duration: 0.8 }}
      >
        SCROLL
      </ScrollIndicator>
    </HeroContainer>
  );
};

export default Hero;
